import React from "react";
import styled from "styled-components";
import SVG from "../static/svg/svg";
import { SvgContainer } from "./Useless";
const Container = styled.div`
    width: 100%;
    height: 50px;
    display: flex;
    flex-direction: row;
    /* align-items: center; */
    justify-content: center;
    svg {
        width: 30px;
        height: 30px;
        fill: white;
    }
`;
const ActionMenu = () => {
    return (
        <Container>
            <SVG type="arrow" />
            <SVG type="heart" />
        </Container>
    );
};

export default ActionMenu;
